import React, { useState, useEffect } from "react";
import axios from "axios";
import styles from "./AdminHome.module.css";

const AdminHome = () => {
  useEffect(() => {
    // Fetch data or perform other side effects if needed
  }, []);

  const handleCreateEvent = async () => {
    try {
      const url = "http://your-api-url/api/events"; // Replace with your API endpoint for creating events
      const eventData = {
        // Replace with the event data you want to send to the server
        name: "New Event",
        date: "2023-12-31",
        description: "This is a new event",
      };
      const response = await axios.post(url, eventData);
      console.log("Event created:", response.data);
    } catch (error) {
      console.error("Error creating event:", error);
    }
  };

  const handleDeleteEvent = async () => {
    try {
      const eventId = "event-id-to-delete"; // Replace with the ID of the event you want to delete
      const url = `http://your-api-url/api/events/${eventId}`; // Replace with your API endpoint for deleting events
      const response = await axios.delete(url);
      console.log("Event deleted:", response.data);
    } catch (error) {
      console.error("Error deleting event:", error);
    }
  };

  return (
    <div className={styles.adminHomeContainer}>
      <h1 className={styles.heading}>Admin HomePage</h1>
      <div className={styles.buttonsContainer}>
        <button className={styles.createEventBtn} onClick={handleCreateEvent}>
          Create Event
        </button>
        <button className={styles.deleteEventBtn} onClick={handleDeleteEvent}>
          Delete Event
        </button>
      </div>
    </div>
  );
};

export default AdminHome;
